import Logo from '../../assets/logo.png'
import { Link } from 'react-router-dom'
//import {Container, Button, Badge} from 'react-bootstrap';
import '../../styles/Header.css';

function Header() {
    function selected(e) {
        e.classList.add("selected");
    }

    return (
        <div class="row text-decoration-none">
            <img class="col-2" src={Logo} alt="freelance" />
            <nav class="col-10 text-end">
                <Link to="/" onClick={selected}>Accueil</Link>
                <Link to="/freelances" className="mx-5">Profils</Link>
                <Link to="/survey/5" className="btn rounded-pill bg-purple">Faire le test</Link>
            </nav>
        </div>
    )
}

export default Header
